import React from "react";
// import styles from "../modules/Emojis.module.css";

export default function Emojis() {
  const EmojisList = [
    { s: emoji, a: Alink },
    { s: emoji, a: Alink },
    { s: emoji, a: Alink },
    { s: emoji, a: Alink },
    { s: emoji, a: Alink },
  ];
  return (
    <div>
      {EmojisList.map((e, i, a) => {
        <div>{e.a}</div>;
      })}
    </div>
  );
}
